ONG.relFlox = new Object();

$(document).ready(function(){
	ONG.relFlox.buscacusto = function() {
		ONG.centrocustoRest.pesquisarNome({
			data : "*",
			success: function(lcenter){							
				ONG.relFlox.montaSelectCentroCusto(lcenter);
			},
			error: function(err){	
				bootbox.alert("Erro ao realizar busca do centro de custo:"+err.responseText);
			}
		});
	}
	ONG.relFlox.montaSelectCentroCusto = function(listaCentroCusto) {
		if(listaCentroCusto != undefined && listaCentroCusto.length > 0 && listaCentroCusto[0].id != undefined) { // montando meus estados
			for(var i = 0; i < listaCentroCusto.length; i++) {
				var option = $( "<option></option>" ).appendTo($('#tipoCC'));
				option.attr( "value", listaCentroCusto[i].id );
				option.html( listaCentroCusto[i].nome );
			}

			var itemsedit2 = document.querySelector('#tipoCC');
			itemsedit2.addEventListener('change', function(){
				var valor2 =	this.value // o valo
			});
			
			ONG.relFlox.buscarFluxo();
		}
	}; // FIM BUSCA PARA ALIMENTAR SELECTED	
	
	ONG.relFlox.pesquisar = function(){
		var cc = $("#tipoCC").val();
		var de = $("#datade").val();
		var ate = $("#dataate").val();
		
		if(cc == "" && de == "" && ate == ""){
			ONG.relFlox.buscarFluxo(undefined, "");
			return false;
		} else if(cc == "" || de == "" || ate == ""){
			bootbox.alert("Selecione um Centro de Custo e o Período.");
			return false;
		}
		
		var d = new Date(de.split("/").reverse().join("-"));
		de = d.getTime();
		d = new Date(ate.split("/").reverse().join("-"));
		ate = d.getTime();
		
    	ONG.fluxoCaixaRest.pesquisarPeriodoCC({
			data : de+"/"+ate+"/"+parseInt(cc),
			success: function(listPesq){													
				ONG.relFlox.buscarFluxo(listPesq);
			},
			error: function(err){							
				bootbox.alert("Erro ao pesquisar, entrar em contato com o Administrador se o problema persistir!");
			}
		});			
	}		
		
	ONG.relFlox.buscarFluxo = function(listFluxo, busca){

		var html = "<table class='table table-responsive custom-table-margin-b'>";
		
		html += 
			"<thead class='table table-striped '>" +
				"<tr>" +					
					"<th> Centro de Custo </th> " +
					"<th> Data </th>" +
					"<th> Tipo </th>" +
					"<th> Descrição </th>" +
					"<th> Usuario </th>" +
					"<th> Evento </th>" +
					"<th> Valor </th>" +
				"</tr>" +
			"</thead>";					
		
		    if ( listFluxo != undefined && listFluxo.length > 0 && listFluxo[0].id != undefined ) {
			  	for(var i = 0; i < listFluxo.length; i++){
			  		html += "<tr>";					
			  		html += "<td>" + listFluxo[i].centroCusto.nome + "</td>";

			  			html += "<td>" + listFluxo[i].data.substring(0,10) + "</td>";
			  			
			  			console.log(listFluxo[i].tipo);
			  			
			  			if(listFluxo[i].tipo == 0){ 
			  				html += "<td>Entrada</td>";
			  			}else if(listFluxo[i].tipo == 1){
			  				html += "<td>Saída</td>";
			  			}else if(listFluxo[i].tipo == 2){
			  				html += "<td>Transferência</td>";
			  			}
			  			html += "<td>" + listFluxo[i].descricao + "</td>";
			  			if(listFluxo[i].pessoa == null || listFluxo[i].pessoa == undefined){
			  				html += "<td></td>";
			  			}else if(listFluxo[i].pessoa != null && listFluxo[i].pessoa != undefined){
			  				html += "<td>" + listFluxo[i].pessoa.nome + "</td>";
			  			}
			  			if(listFluxo[i].evento == null || listFluxo[i].evento == undefined){
			  				html += "<td></td>";
			  			}else if(listFluxo[i].evento != null && listFluxo[i].evento != undefined){
			  				html += "<td>" + listFluxo[i].evento.nome + "</td>";
			  			}
			  			html += "<td>" + "R$ " + parseFloat(listFluxo[i].valor).toFixed(2).replace('.',',') + "</td>";	
			  		html += "</tr>";  
			    }
		    }else{
			    if(listFluxo == undefined || (listFluxo != undefined && listFluxo.length > 0)){
			    	ONG.fluxoCaixaRest.pesquisarNome({
						data : "*",
						success: function(listFluxo,busca){													
							ONG.relFlox.buscarFluxo(listFluxo,busca);
						},
						error: function(err){							
							bootbox.alert("Erro ao Buscar informações de Fluxo de caixa, entrar em contato com o Administrador se o problema persistir!");
						}
					});						    
				}else{					
					html += "<tr><td colspan='3'>Nenhum registro encontrado</td></tr>";
				}
		    }
		html +="</table>";
		$("#rextratocentrocusto").html(html);
	}
	
	ONG.relFlox.buscarFluxo(undefined, "");	 	
	
	ONG.relFlox.generattorPDF = function() {
		var cc = $("#tipoCC").val();
		var de = $("#datade").val();
		var ate = $("#dataate").val();
		
		if(cc == "" && de == "" && ate == ""){
			bootbox.alert("Selecione um Centro de Custo e o Período, para gerar o relatório.");
			return false;
		} else if(cc == "" || de == "" || ate == ""){
			bootbox.alert("Selecione um Centro de Custo e o Período, para gerar o relatório.");
			return false;
		}
		
		var d = new Date(de.split("/").reverse().join("-"));
		de = d.getTime();
		d = new Date(ate.split("/").reverse().join("-"));
		ate = d.getTime();
		
		var fdatade= $("#datade").val().split('-').reverse().join('/');
		var fdataate = $("#dataate").val().split('-').reverse().join('/');
		
    	ONG.fluxoCaixaRest.pesquisarPeriodoCC({
			data : de+"/"+ate+"/"+parseInt(cc),
			success: function(listPesq){													
				ONG.relFlox.montapdf( listPesq, fdatade,fdataate );
			},
			error: function(err){							
				bootbox.alert("Erro ao gerar relatório, entrar em contato com o Administrador se o problema persistir!");
			}
		});			
	}
	ONG.relFlox.pesquisar = function(){
		
		var cc = $("#tipoCC").val();
		var de = $("#datade").val();
		var ate = $("#dataate").val();
		
		if(cc == "" && de == "" && ate == ""){
			ONG.relFlox.buscarFluxo(undefined, "");
			return false;
		} else if(cc == "" || de == "" || ate == ""){
			bootbox.alert("Selecione um Centro de Custo e o Período.");
			return false;
		}
		
		var d = new Date(de.split("/").reverse().join("-"));
		de = d.getTime();
		d = new Date(ate.split("/").reverse().join("-"));
		ate = d.getTime();
		
    	ONG.fluxoCaixaRest.pesquisarPeriodoCC({
			data : de+"/"+ate+"/"+parseInt(cc),
			success: function(listPesq){													
			    ONG.relFlox.buscarFluxo(listPesq);
			},
			error: function(err){							
				bootbox.alert("Erro ao pesquisar, entrar em contato com o Administrador se o problema persistir!");
			}
		});			
	}
	ONG.relFlox.montapdf = function( listPesq, fdatade, fdataate ) {
		
		var header = [];

		header.push(
			{
				colSpan: 2,			
		        width: 125,  
		        image: 'data:image/jpeg;base64,',
			},
			{},
			{
				colSpan: 4,
				text: 'Relatório centro de custo ONG CEPE', 
				alignment: 'center',
				margin: [0, 35, 0, 35],
		        style: 'tableHeader', 

			},	{}, {},  {}
			
		); // HEADER 
				
		var data = new Date(),
		dia = data.getDate(),
		mes = data.getMonth() + 1,
		ano = data.getFullYear();
		hora = data.getHours(),
		minutos = data.getMinutes(),
		segundos = data.getSeconds();
		
		var datahorario = dia + "/" + mes + "/" + ano + " as: " + hora + ":" +minutos + ":" + segundos

		var nomecentroCusto = "";
		
		for (var i = 0; i < listPesq.length; i++) {
			
			if( listPesq[i].id = $("#tipoCC").val() ){
				nomecentroCusto = listPesq[i].centroCusto.nome;
			}
		}
		
		var table_body = [							    	
        	header,
        	[ //Data Inicial
        		{
			        colSpan: 2,
			        text: 'Data Inicial:',
			        style: 'tablesubInf', 
				    alignment: 'left',
					margin: [0, 10, 0, 10]
			    },	
			    {},
			    {			    	
			    	colSpan: 4,
			        text: fdatade,
			        style: 'tableConteudos', 
				    alignment: 'left',
					margin: [10, 10, 0, 10]
			    }, {}, {}, {}
		    ],
		    
		    [ //Data Final:
        		{
			        colSpan: 2,
			        text: 'Data Final:',
			        style: 'tablesubInf', 
				    alignment: 'left',
					bold: true,
					margin: [0, 10, 0, 10]
			    },{},			    
			    {			    	
			    	colSpan: 4,
			        text: fdataate,
			        style: 'tableConteudos', 
				    alignment: 'left',
					margin: [10, 10, 0, 10]
			    }, {}, {}, {}
		    ],
		    
        	[ //Centro de custo
	        	{
			        colSpan: 2,
			        text: "Centro de custo: ",
			        style: 'tablesubInf', 
				    alignment: 'left',
            		margin: [0, 20, 0, 10]
			    },
			    {}, 
			    {
			        colSpan: 4,
			        text:  nomecentroCusto,
			        style: 'tableConteudos', 
				    alignment: 'left',
            		margin: [5, 20, 0, 10]
			    }, {}, {}, {}
		    ],
		    
        	[ //tableSubheaderInfs
        		{
        			text: "Data", 
        			alignment: 'center',
        			style: 'tableSubheaderInfs',
            		margin: [0, 20, 0, 10]
        		},
        		{
        			text: "Tipo",  
        			alignment: 'center',
            		style: 'tableSubheaderInfs',
            		margin: [0, 20, 0, 10]
        		},
        		{
        			text: "Descrição",  
        			alignment: 'center',
            		style: 'tableSubheaderInfs',
            		margin: [0, 20, 0, 10]
        		},
        		{
        			text: "usuario",  
        			alignment: 'center',
            		style: 'tableSubheaderInfs',
            		margin: [0, 20, 0, 10]
        		},
        		{
        			text: "evento",  
        			alignment: 'center',
            		style: 'tableSubheaderInfs',
            		margin: [0, 20, 0, 10]
        		},
        		{
        			text: "valor",
        			alignment: 'center',
            		style: 'tableSubheaderInfs',
            		margin: [0, 20, 0, 10]
        		}
        	],       	
        ];
		var valoresSoma = [];
		var valoresSub = [];
		
		for (var i = 0; i < listPesq.length; i ++) {
			
			if ( listPesq[i].tipo == 1 ){
				valoresSub.push( listPesq[i].valor );
			} else if ( listPesq[i].tipo != 1 && listPesq[i].tipo != 3) {
				valoresSoma.push( listPesq[i].valor );
			}
			
			var tipomsg = "";
			
			if (listPesq[i].tipo == 0){
				tipomsg = "Entrada";
			} else if ( listPesq[i].tipo == 1 ){
				tipomsg = "Saída";
			} else if ( listPesq[i].tipo == 2) {
				tipomsg = "Transferência";
			} 
			var retorno = "";
			if( listPesq[i].evento != null  ) {
				retorno = {text: listPesq[i].evento.nome, style: 'tablefont', alignment: 'center'}
			}else if ( listPesq[i].evento == null ) {
				retorno = {text: "sem evento", style: 'tablefont', alignment: 'center'}
			} 
			
			table_body.push(
				[
					{text: listPesq[i].data.substring(0,10), style: 'tablefont', alignment: 'center'},
					{text: tipomsg, style: 'tablefont', alignment: 'center'},
					{text: listPesq[i].descricao, style: 'tablefont', alignment: 'center'},
					{text: listPesq[i].usuario.nome, style: 'tablefont', alignment: 'center'},
					retorno,
					{text: "R$ " + parseFloat(listPesq[i].valor).toFixed(2).replace('.',','), style: 'tablefont', alignment: 'right'}
				]	
			);
		}
		
		var soma = 0;
		var subtracao = 0;
		
		for (i = 0; i < valoresSoma.length; i++) {
			soma += valoresSoma[i];
		}
		
		for (var i = 0; i < valoresSub.length; i ++) {
			subtracao += valoresSub[i];
		}
		
		var total = (soma - subtracao);
		
		console.log(" soma " + soma );
		console.log(" Sub " + subtracao);

		table_body.push(
			[
				{
					text: "Valor total:", 
					style: 'tableConteudos', 
					alignment: 'left',
					colSpan: 4
				},
				{},
				{},
				{},		
				{					
					colSpan: 2,
					text: "R$ " + parseFloat(total).toFixed(2).replace('.',','), 
					style: 'tableConteudos', 
					alignment: 'right',
				},		
				{},
			]
		)
		
		var formatgeneratorPDF = {
				content: [
					{
						style: 'table',
						table: {
							widths: [80, 85, 90, 90, 100, 92],
							body: table_body
						},
						layout: {
							fillColor: function (i, node) { return (i % 2 === 0) ?  '#f9f9f9' : null; }
						},
						footer: {
						    columns: [
						      'Left part',
						      { text: 'Right part', alignment: 'right' }
						    ]
						  },
					},
									
				],
				 footer: {
					    columns: [
					    	{
								text: 'Relatório gerado: ' + datahorario,
								alignment: 'left',
						        style: 'tableEnd', 
							}	
					    ]
					  },
				styles: {		
					tableHeader: {
						bold: true,
						fontSize: 18,
					},
					tablesubInf: {
						bold: true,
						fontSize: 18
					},
					tableConteudos: {
						bold: false,
						fontSize: 16,
					},
					tableEnd: {
						bold: false,
						fontSize: 16,
						margin: [0, 0, 0, 0]
					},
					table: {
						margin: [-39, -39, 15, 15]
					},
					tableSubheaderInfs:{
						bold: true,
						fontSize: 18
					},					
					tablefont:{
						bold: false,
						fontSize: 14,
					},
					tableExample: {
						margin: [0, 5, 0, 5]
					}
				},
				defaultStyle: {
					// alignment: 'justify'
				}
			}
		var n = new Date();
		var nomearq = String(n).substring(8,10)+"_"+(1+n.getMonth())+"_"+String(n).substring(11,24).replace(' ','_')+'_extratoCEPE';
		pdfMake.createPdf(formatgeneratorPDF).download(nomearq+".pdf");
	}
})